PRAGMA foreign_keys = ON;

--
-- Name: log1; Type: TABLE
--

CREATE TABLE "cases" (
  "id" TEXT,
  PRIMARY KEY (id)
);

CREATE TABLE "events" (
  "id" int,
  "idcase" TEXT,
  "activity" TEXT,
  "resource" TEXT,
  "year" NUMERIC,
  "month" NUMERIC,
  "day" NUMERIC,
  "cost" NUMERIC,
  PRIMARY KEY (id),
  FOREIGN KEY (idcase) REFERENCES cases(id)
);










